import 'bootstrap/dist/css/bootstrap.min.css';
import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import Router from './Component/Router/Router'
import RecordDetails from './Component/RecordDetails/RecordDetails'
import reportWebVitals from './reportWebVitals';
import { BrowserRouter,Switch,Route} from "react-router-dom";
import { Auth0Provider } from "@auth0/auth0-react";
import  Login from './Component/Login/Login'
import Dashboard from './Component/Dashboard/Dashboard';
ReactDOM.render(
  <div>
     <Auth0Provider
    domain="studentbe.us.auth0.com"
    clientId="3DCohTEvcsLiGuvu68w0jpJEtj6SaU39"
    redirectUri={window.location.origin}
  >



    <BrowserRouter>
    <App />
      <Switch>
      <Route path="/Login" component={Login} />
      <Route path="/recordsdetails/:Id" component={RecordDetails}/>
     { isAuthenticated ? <Route path="/dashboard" component={Dashboard} />: loginWithRedirect()}
      </Switch>  
    </BrowserRouter>
    </Auth0Provider>
  </div>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
